async componentDidMount(){
     
    const [
        recommendationsresponse,
        projectsresponse,
        blogsresponse,
        skillsresponse
     ]= await Promise.all([
        axios.get("http://127.0.0.1:9000/api/recommendations"),
        axios.get("http://127.0.0.1:9000/api/projects"),
        axios.get("http://127.0.0.1:9000/api/blogs"),
        axios.get("http://127.0.0.1:9000/api/skills")
     ]);


     const newstate={};

    if(recommendationsresponse.data.issuccessful && recommendationsresponse.data.result.length!==0){
        
            newstate.recom=recommendationsresponse.data.result;
     }
     

     if(projectsresponse.data.issuccessful && projectsresponse.data.result.length!==0){
        
            newstate.projects=projectsresponse.data.result;
       
     }

     if(blogsresponse.data.issuccessful && blogsresponse.data.result.length!==0){
        
           newstate.blogs= blogsresponse.data.result;
           
     }
    //  console.log(blogsresponse.data.result);

     if(skillsresponse.data.issuccessful && skillsresponse.data.result.length!==0){
        
            newstate.skills= skillsresponse.data.result;
        
     }

     this.setState( newstate);
    // console.log(this.state);
    //  console.log(this.state.blogs);
// console.log(newstate);

}

